soil.subsites.comments:
[Bulk density 02] Centre = OBS 09 but, surface with scattered dark gravel plus particulates and duricrust; 
Rocks: 0-10cm subangular ironstone 0.3-1.7cm (mode 0.4cm) 5-10%; 10-20cm ant galleries; 20-30cm incl. greenstone & quartz to 1cm, & mottles/nodules to 30%. 
0-10cm 2.5YR4/6; 10-20cm 2.5YR5/6//(4/6); 20-30cm 2.5YR5/6
